\documentclass{article}
\usepackage{tikz}

\begin{document}

\begin{tikzpicture}[scale=1.5]
    % Define coordinates for the points
    \coordinate (A) at (0,0);
    \coordinate (B) at (1,0);
    \coordinate (C) at (2,0);
    \coordinate (D) at (3,0);
    \coordinate (E) at (4,0);

    \coordinate (A') at (0,1);
    \coordinate (B') at (1,1);
    \coordinate (C') at (2,1);
    \coordinate (D') at (3,1);
    \coordinate (E') at (4,1);

    \coordinate (A'') at (0,2);
    \coordinate (B'') at (1,2);
    \coordinate (C'') at (2,2);
    \coordinate (D'') at (3,2);
    \coordinate (E'') at (4,2);

    \coordinate (A''') at (0,3);
    \coordinate (B''') at (1,3);
    \coordinate (C''') at (2,3);
    \coordinate (D''') at (3,3);
    \coordinate (E''') at (4,3);

    % Draw the yellow region for each case
    \draw[fill=yellow] (A') -- (B') -- (C') -- (D') -- cycle;
    \draw[fill=yellow] (A'') -- (B'') -- (C'') -- (D'') -- cycle;
    \draw[fill=yellow] (A''') -- (B''') -- (C''') -- (D''') -- cycle;

    % Draw the dashed lines
    \draw[dashed] (A) -- (A');
    \draw[dashed] (B) -- (B');
    \draw[dashed] (C) -- (C');
    \draw[dashed] (D) -- (D');
    \draw[dashed] (E) -- (E');

    \draw[dashed] (A) -- (A'');
    \draw[dashed] (B) -- (B'');
    \draw[dashed] (C) -- (C'');
    \draw[dashed] (D) -- (D'');
    \draw[dashed] (E) -- (E'');

    \draw[dashed] (A) -- (A''');
    \draw[dashed] (B) -- (B''');
    \draw[dashed] (C) -- (C''');
    \draw[dashed] (D) -- (D''');
    \draw[dashed] (E) -- (E''');

    % Draw the black dashed squares
    \draw[line width=1pt,dashed,black] (0,-0.2) rectangle (1,1.2);
    \draw[line width=1pt,dashed,black] (2,-0.2) rectangle (3,1.2);

    % Draw the text for each case
    \node at (0.5,0.5) {\((0^{+})\)};
    \node at (2.5,0.5) {\((0^{-})\)};
    \node at (4.5,0.5) {\((0^{++})\)};
    \node at (6.5,0.5) {\((0^{--})\)};

    % Draw the text for the main region
    \node at (1,-0.7) {\((0)\)};

\end{tikzpicture}

\end{document}
